import React, { Component ,Fragment} from 'react';
import {Link} from 'react-router-dom';


const UsersList = props => {
    const { users } = props;
    console.log(props);

    // if (!isLoaded) {
    //     return <div>Loading...</div>;
    //   } else {
    return (
        <Fragment>

        <div className="container">


  <table className="table">
    <thead>
      <tr>
        <th>Id</th>
        <th>Name</th>
        <th>Email</th>
        <th>Age</th>
        <th>Company Name</th>
        <th>City</th>

      </tr>
    </thead>
    <tbody>
      {users.map(({id,age,first_name,company_name,city,email,last_name,state,zip,web}, index) => {
        return (
      <tr key={index}>

        <td><Link to={{
            pathname: `/detail/${id}`,
            currUser: {id,age,first_name,company_name,city,email,last_name,state,zip,web}}}>{id}</Link> </td>
        <td>{first_name}</td>
        <td>{email}</td>
        <td>{age}</td>
        <td>{company_name}</td>
        <td>{city}</td>

      </tr> 
        )
      })}


    </tbody>
  </table>

</div>

        </Fragment>

    );


}
export default UsersList;
